ndestens in Prues Augen. Sie ist von der Tatsache, daß die Schwestern Hexen sind, und daß sie diejenige war, die das Buch der Schatten entdeckt hat, faziniert.',NULL),(41106,NULL,41105,4361,NULL,NULL,2,NULL,'2003-10-20 20:44:35',NULL,NULL,NULL,NULL),(41108,40784,41107,4361,NULL,NULL,1,NULL,'2003-10-20 20:45:19',NULL,NULL,NULL,NULL),(41111,41110,41109,2206,NULL,NULL,2,NULL,'2003-10-20 20:46:03',NULL,NULL,NULL,NULL),(41113,40789,41112,5653,NULL,NULL,1,NULL,'2004-05-20 12:48:42','shows/charmed/images/cast/leo.jpg',NULL,NULL,NULL),(41115,NULL,41114,27463,NULL,NULL,1,NULL,'2003-10-20 21:04:13',NULL,NULL,NULL,NULL),(41118,41117,41116,27463,NULL,NULL,1,NULL,'2003-10-20 21:05:14',NULL,NULL,NULL,NULL),(41121,41120,41119,38112,NULL,NULL,1,NULL,'2003-10-20 21:05:59',NULL,NULL,NULL,NULL),(41124,41123,41122,38112,NULL,NULL,1,NULL,'2003-10-20 21:06:20',NULL,NULL,NULL,NULL),(41126,41133,41125,21290,NULL,NULL,1,'Manja Döring','2004-05-23 19:56:17','shows/roswell/images/cast/shiri_appleby.jpg',NULL,'',NULL),(41129,41128,41127,15625,NULL,NULL,1,NULL,'2003-10-20 21:19:07',NULL,NULL,NULL,NULL),(41132,41131,41130,15625,NULL,NULL,1,NULL,'2003-10-20 21:19:37',NULL,NULL,NULL,NULL),(41136,41135,41134,21290,NULL,NULL,1,'Ulrike Stürzbecher','2004-05-23 19:56:46','shows/roswell/images/cast/katherine_heigl.jpg',NULL,'',NULL),(42206,42205,42204,38972,NULL,NULL,1,NULL,'2003-10-21 20:36:15',NULL,NULL,NULL,NULL),(49863,40795,49862,21290,NULL,NULL,1,NULL,'2004-05-23 19:56:28','shows/roswell/images/cast/majandra_delfino.jpg',NULL,'',NULL),(49865,40792,49864,21290,NULL,NULL,1,NULL,'2004-05-23 19:55:58','shows/roswell/images/cast/jason_behr.jpg',NULL,'',NULL),(49867,40796,49866,21290,NULL,NULL,1,NULL,'2004-05-23 19:56:11','shows/roswell/images/cast/brendan_fehr.jpg',NULL,'',NULL),(49871,49868,49870,21290,NULL,NULL,1,NULL,'2004-05-23 19:56:05','shows/roswell/images/cast/emilie_de_ravin.jpg',NULL,'',NULL),(49873,40799,49872,21290,NULL,NULL,1,NULL,'2004-05-23 19:56:36','shows/roswell/images/cast/william_s