2004-05-25 11:23:48',NULL,NULL,'',NULL),(58460,58459,58458,12465,NULL,NULL,1,NULL,'2004-05-25 11:24:11',NULL,NULL,'',NULL),(58655,58652,58651,25791,NULL,NULL,1,'Jennifer Wippich','2004-05-28 20:54:34','shows/sister/images/cast/tamera.jpg',NULL,'Tamera Anne Campbell was brought up by her Dad, Ray, in a rather protected environment. Her Mum died when she was very young and she barely remembers her. Tamera is outgoing and goofy sometimes. She\'s an expert on \'Boyz II Men\' as well as \'Coolio\', but not very focused on school.',NULL),(58660,58657,58656,25791,NULL,NULL,1,'Melanie Jung','2004-05-28 20:54:09','shows/sister/images/cast/tia.jpg',NULL,'Tia Landry lived alone with her Mum, Lisa, for fourteen years before moving in with Ray and Tamera. She was brought up in a relatively poor environment. She is very bright and an honor student.',NULL),(58663,58662,58661,25791,NULL,NULL,1,'Inge Solbrig','2004-05-28 20:54:45','shows/sister/images/cast/lisa.jpg',NULL,'Lisa Landry has a strong personality. She has the ability to lighten up a room, but also to drive people crazy. Her big dream is to become a famous fashion designer. She\'s always in lack of money and likes to lie about her age. Lisa loves food and eats constantly.',NULL),(58666,58665,58664,25791,NULL,NULL,1,'Joachim Höppner','2004-05-28 20:55:06','shows/sister/images/cast/ray.jpg',NULL,'Ray Campbell is upper-middle-class. He owns a limousine service and earns enough money to provide his family with everything they need. He\'s a loving father, but has trouble finding romance in his life after his wife, Ellen, died many years ago. According to Lisa he\'s too up-tight and boring.',NULL),(58669,58668,58667,25791,NULL,NULL,1,'Butz Combrinck','2004-05-28 20:54:57','shows/sister/images/cast/roger.jpg',NULL,'Roger is the next door neighbor who constantly flirts with the twins...or any other girl for that matter. He is not very popular at school and often gets himself into trouble.',NULL),(58975,58974,58973,55850,NULL,NULL