p>\r\n<p>An der Arcadia High arbeitet Helen zunächst als Sekretärin, bis eine Stelle für den Kunstlehrer offen wird und mit Wills drängen nimmt sie diese auch an. Seit dem sie wieder Kunst unterrichtet, lässt sie auch ihrer künstlerischen Seite freien lauf und stellt ihre Gemälde in Galerien aus.</p>\r\n<p>Durch die Arbeit wurde Helen eine sehr beschäftigte Frau, findet aber dennoch Zeit für ihre Familie, die sie über alles liebt. Jedoch ist Helen ziemlich unsicher was Joans Beziehung zu Gott betrifft, sie bemerkt starke Veränderungen an ihrer Tochter.</p>',NULL),(65445,65444,65443,65423,NULL,NULL,1,NULL,'2004-11-07 10:48:02','shows/joan/images/cast/joan_small.jpg',NULL,'<p>Joan ist ein typisches 16jähriges Mädchen. Sie ist sarkastisch, widerspricht dauernd ihren Eltern, geht nicht gerne zur Schule, wünscht sich einen Freund und spricht zu Gott. Das letzte ist wohl nicht mehr so typisch. Aber Joan war mal ganz durchschnittlich, bis Gott sie auserwählte seine Missionen des Guten zu erfüllen. Alles was Gott will ist, das jede seiner Kreationen seine eigentliche Bestimmung erfüllt und um dies zu erreichen, braucht er die Hilfe von Joan.</p>\r\n<p>Doch Gott sieht auch das in Joan was unter der Teeangerangst und der sackartigen Kleidung versteckt ist, einen guten Menschen. Egal wie es mit ihr selbst steht, Joan sorgt sich immer um andere Menschen  eine Eigenschaft die sich nicht über Nacht entwickelte, Joan war schon immer Hilfsbereit.</p>\r\n<p>Anfangs wollte sie nicht Gottes Aufgaben erledigen, sie befürchte man würde sie für verrückt erklären, doch mit den Aufgaben begann Joan die Menschen um sich kennen zulernen und ihre Probleme zu verstehen. Durch eine Aufgabe fand sie auch ihre neuen Freunde, Grace Polk und Adam Rove und verbringt seitdem ihre Zeit mit ihnen.</p>\r\n<p>Trotzdem hat Joan immer noch Einwände bei manchen Aufgaben von Gott, jedoch willigt sie meist ein, schließlich ist er ja Gott. Und durch ihn entwickelt sich Joan zu einer großartigen Person.</p>',NULL),(65448,65447,65446,65423,NULL,NULL,1,NULL,'2004-11-07 10:49:03','shows/joan/images/cast/kevin_small.jpg',NULL,'<p>Kevin wuchs als ein Gutaussehender, populärer Athlet auf. Er war in der Basketballmannschaft, sollte später für die Arizona Universität spielen und hatte eine Freundin namens Beth, die er mehr als verehrte. Doch all dies änderte sich an einem verhängnisvollen Tag. Wie es am Ende der High School üblich war, ging Kevin zu einer Party und betrank sich. Dort stellte ihm seine Freundin wegen einer Affäre zur Rede und erprobt machte Kevin Schluss. Betrunken setzte er sich in ein Auto, das ebenfalls von einem Betrunken gefahren wurde und geriet in einen schrecklichen Autounfall. Seit diesem Tag ist Kevin an einen Rollstuhl gefesselt.</p>\r\n<p>Anfangs akzeptierte Kevin seine Behinderung nicht. Er hat seitdem Unfall kein Gefühl mehr in den Beinen und bekam keine Heilungschancen von den Ärzten. Durch diese Tatsache verbitterte er und ist nicht mehr gut anzusprechen. Statt freundlicher Konversation macht er lieber sarkastische Anmerkungen und legt sich mit jeden an, insbesondere mit seinem Vater. Schließ aber half Joan Kevin durch eine Aufgabe von Gott sein Leben in die richtige Bahn zuschieben. Sie überzeugte ihm sein Leben zu akzeptieren wie es ist und das Beste daraus zu machen.</p>\r\n<p>Kurze Zeit später begann Kevin bei der Zeitung Arcadia Herald zuarbeiten. Dort entwickelte er auch einen Beziehung zu Rebecca, seinem Boss. Sie überzeugte ihm als Journalist für die Zeitung zu schreiben und er entdeckte sein Talent dafür. Doch wie Kevin ist, gefährdete er die Beziehung zu Rebecca, indem er sich mit einer Frau einließ, die er nur interviewen  sollte. Ebenfalls hat Kevin wieder begonnen Basketball zuspielen  er trat der Rollstuhlmannschaft bei.</p>',NULL),(65451,65450,65449,65423,NULL,NULL,1,NULL,'2004-11-07 10:49:54','shows/joan/images/cast/luke_small.jpg',NULL,'<p>Freak, Verrückter, Trottel; dies sind Namen die Luke über die Jahre zuhören bekam und sie auch tolerierte. Überaus intelligent und mit einer Gabe für die Wissenschaft gesegnet, musste sich Luke diese und andere Behandlungen nicht nur von seinen Mitschülern gefallen lassen, sondern auch von seinem älteren Bruder und seiner Schwester. Von außen sah es aus als würde das Luke nichts anhaben, aber innerlich schmerzten es im sehr, insbesondere die Behandlung von seiner Familie und das schlechte Zusammenleben mit seinem Bruder Kevin. Daraus resultierte die Freude von Luke als er erfuhr dass sein Bruder für immer an den Rollstuhl gefesselt sei. Endlich würde Kevin erfahren was es für ein Gefühl ist, wenn jemand auf einen herab sieht.</p>\r\n<p>Abgesehen davon liebt es Luke zu experimentieren und neues zu lernen. Nach einer Zeit fand er auch Freunde die dasselbe Interesse teilen, Glynis und Friedman. Glynis wollte aber mehr als nur eine freundschaftliche Beziehung, sie verliebte sich in Luke. Luke bemerkte dies aber nicht und erfuhr es erst von Friedman. Sein Interesse galt nur Grace, die ihm aber abwies und er darauf eine Beziehung mit Glynis einging. Er mochte sie zwar sehr, doch ihrer Beziehung mangelte es an Stabilität, Luke war einfach nicht wirklich verliebt. Nachdem Glynis einen Kurs für Make-Up belegte, entdeckte sie neues Selbstvertrauen in ihr und bemerkte die Blicke der Jungs in der Schule. Luke der das auch sah, verstand das Glynis Zeit braucht um mit dieser neuen Situation klar zukommen und beendete die Beziehung.</p>\r\n<p>Weiterhin galt aber sein Interesse der Person die ihm seinen ersten Kuss schenkte, nämlich Grace.</p>',NULL),(65454,65453,65452,65423,NULL,NULL,1,NULL,'2004-11-07 10:41:21','shows/joan/images/cast/adam_small.jpg',NULL,'',NULL);
