INSERT INTO `fanfics` VALUES (1,'Going Home Again','PG','Sam goes home for a party and has to leave Brooke in NY.',NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(2,'Strange Road To Salvation','R','What happens after Nicole gunned the car and aimed for Brooke and the fallout from that night. This picks up from that moment on.',331,NULL,1,'','','2004-04-16 19:13:28'),(3,'A Higher Power',NULL,NULL,4,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(4,'Truth and Consequences',NULL,NULL,5,3,1,NULL,NULL,'2003-10-26 20:39:39'),(5,'The Next Illogical Step',NULL,NULL,6,4,1,NULL,NULL,'2003-10-26 20:39:39'),(6,'If Destiny Wills','','',NULL,5,1,'','','2004-04-16 19:14:45'),(7,'Desperately Wanting','PG13',NULL,NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(8,'Sex, Spies and Holo Programs','R','B\'Elanna gets a shock when she accidentally activates someone\'s \'recreational\' program on the holodeck and decides to investigate, which leads her to a surprising (well, to her, if not the reader) revelation.',NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(9,'Research','PG13',NULL,NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(10,'Right Place','PG13',NULL,NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(11,'Every Boy\'s Dream','','Brooke wants to try something new in bed, Josh is in favour.',NULL,NULL,1,'','','2004-04-16 19:56:06'),(12,'Girl\'s Night','PG13','Sam and Brooke\'s friends help them through a trying time.',NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(13,'Magical Interlude',NULL,NULL,NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(14,'Mind Games',NULL,'What if Willow had something she didn\'t want Buffy to hear during `Earshot\'?',NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(15,'My Slayer Lady',NULL,'Buffy and Willow offer Faith some dating advice...but Cordelia intervenes',NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(16,'A Night for Reflection',NULL,'An encounter with Angelus leaves Willow with time to reflect?',17,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(17,'A Day of Revelation',NULL,'Willow and Buffy have a revealing conversation in the hospital.',18,16,1,NULL,NULL,'2003-10-26 18:52:08'),(18,'A Time for Revenge',NULL,'Willow decides to end things once and for all.',NULL,17,1,NULL,NULL,'2003-10-26 20:39:39'),(19,'Shifting Gears',NULL,'After \'Promblems\'. Sam deals with the fall-out.',NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(20,'Thou Shalt Not Suffer A Witch To Live',NULL,NULL,NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(21,'The Adventures of Buffy & Evil Vampire Willow',NULL,'Comic',NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(22,'Out In Thirty Days','NC17','',NULL,NULL,1,'','','2004-04-16 20:01:02'),(23,'A Valentines Day In The Life Of ...','PG',NULL,NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(24,'Kismet',NULL,NULL,NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(25,'My Teddy Bear','','',NULL,NULL,1,'','','2004-04-16 20:02:26'),(26,'The Runner Stumbles','PG13','Mrs. Colombo (i.e. Jane) finally puts the pieces together',NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(27,'Toward the Sunset','','Set in the old west, can gunfighter Jess, and the schoolteacher Mattie find a way to be together.',NULL,NULL,1,'','','2004-04-16 20:04:41'),(28,'Back Trouble',NULL,'Laid up with back trouble, forbidden from *everything*--what will the warrior princess do?',NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(29,'Bargain Hunting',NULL,'You know how those Potedaians are--can Xena find out, when Gabrielle is kidnapped and Xena doesn\'t have enough dinars to buy her back.',NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(30,'Best Laid Plans',NULL,'Why is a certain warrior princess picking out men for her companion, and what exactly does she have in mind?',NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(31,'Crossing Over',NULL,'Hercules, Typhon, a magic flute, and Xena and Gabrielle\'s increasing awareness of their feelings make for a fun romp.',NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(32,'Damage Control',NULL,'After Gabrielle\'s marriage to Perdicus, Xena leaves her friend in Potedaia, but they still have unfinished business to deal with.',NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(33,'Delicacy',NULL,'What\'s a bard to do when Amazons insist on a victory celebration when she has her own plans for victory celebrations?',NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(34,'Guessing Games',NULL,'Who knew Gabrielle liked charades so much?',NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(35,'Freedom Revelation','PG13','A month after Viva Las Vegas, what would happen if Liz was forced to tell Tess about the events in The End of the World?',NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(36,'Charming Faith',NULL,NULL,NULL,NULL,0,NULL,NULL,'2003-10-26 20:39:39'),(37,'Changing Times','R',NULL,NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(38,'Redemption',NULL,NULL,39,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(39,'The Faith Factor','R','Faith faces the challenge of staying true to her newfound friends and newfound love.',NULL,38,1,'','','2004-04-16 20:06:34'),(40,'The Wolf Within','PG13','Willow discovers that there is more to her than meets the eye, and it could tear her life apart.',NULL,NULL,1,'','','2004-04-16 20:06:42'),(41,'Just a Day in the Life',NULL,'Buffy has more trouble than she can handle, between dealing with Riley, her feelings for Willow, and a rogue Warlock who is out on a power grab.',42,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(42,'Aftershocks',NULL,'Buffy and Willow try to deal with the stress of their relationship, Coming Out to friends, and of course, Valentine\'s Day.',44,41,1,NULL,NULL,'2003-10-26 18:52:08'),(43,'The Longest Night',NULL,NULL,NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(44,'Spirit\'s Flame',NULL,'Willow has a surprise in store for her, as her encounter with the Goddess leaves lasting effects.',NULL,42,1,NULL,NULL,'2003-10-26 18:52:08'),(45,'Fire and Ice','','A young heiress and reporter encounters a dangerous thief with a past, and neither one can resist the chemistry between them.',NULL,NULL,1,'','','2004-04-16 20:07:02'),(46,'Bound','NC17','',NULL,NULL,1,'','','2004-04-16 20:07:30'),(47,'Change Of Mind','PG','Ally realizes she is gay. This makes her relationships with her friends change, especially with Ling. Is set a couple of months after \"Buried Pleasures\".',NULL,NULL,1,'','','2004-04-16 20:08:52'),(48,'A Thin Line','PG13','',55,NULL,1,'','','2004-04-16 20:09:18'),(49,'About a Girl','','What was going on in the girls\' minds during their time together in the episode \"Falling into Place\"?',365,NULL,1,'','','2004-04-16 20:09:25'),(50,'The Closet','','The students of Kennedy High (you know the twelve of them that are shown) go on a field trip to New York...',NULL,NULL,1,'','','2004-04-16 20:09:32'),(51,'Forgive if Not Forget','','What would have happened if Faith had never escaped on that train?',NULL,NULL,1,'','','2004-04-16 20:09:41'),(52,'The Luck of the Draw','','',54,56,1,'','','2004-04-16 20:09:48'),(53,'Starlight','','Buffy\'s been hurt by a demon and reflects on the one she loves most - Willow. Follow the gang on a quest to hunt the demon down and help Buffy recover.',NULL,NULL,1,'','','2004-04-16 20:10:12'),(54,'Walking After Midnight','','',NULL,52,1,'','','2004-04-16 20:10:23'),(55,'Well, This Happened','PG13','',NULL,48,1,'','','2004-04-16 20:10:32'),(56,'And It All Became So Clear',NULL,NULL,52,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(57,'Camelot','PG','There\'s more to Isabel\'s relationship with the \'new girl\' than meets the eye.',NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(58,'The Chemicals Between Us','PG13',NULL,60,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(59,'Finding the Fun','PG',NULL,NULL,NULL,1,NULL,NULL,'2003-10-26 20:39:39'),(60,'Home, Sweet Home','PG13',NULL,NULL,58,1,NULL,NULL,'2003-10-26 20:39:39'),(61,'It Means She Likes You','PG13',NULL,NULL,NULL,1,NULL,NULL,'2003-10-26 18:52:08'),(62,'A Little Birdie Told Me So',NULL,'Buffy is in a café waiting for Willow and over hears something interesting.',64,NULL,1,NULL,NULL,'2003-10-26 