  `video_id` bigint(20) default NULL,
  `sequence` int(11) default NULL,
  `lastmodified` timestamp NOT NULL default CURRENT_TIMESTAMP,
  `movie_id` bigint(20) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

